import React from "react";
import './Button.scss';

const Button: React.FC<{
    title: string,
    type?: 'success' | 'danger',
    extraClasses?: string
}> = (props) => {
    return (
        <button className={`btn btn--${props.type} ${props.extraClasses}`}>
            {props.title}
        </button>
    );
};

export default Button;
